INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (16614068, 1, 0.5, 1, "誕生、日……？\n私のですか？\nなぜそんなことを\n覚えているのですか？", 11, 0, 102711, 10, 16614, 0);
