INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (27814069, 1, 0.5, 1, "こ、このケーキはクウカのために……？\nそれに、ドＳさんまで……ま、まさか、\nここにあるローソクを使ってクウカに\n何か良からぬことを……！？", 11, 0, 104511, 10, 27814, 0);
