INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (35314068, 1, 0.5, 1, "でも、お返しとかあるでしょ？\nちゃんとみんなに、同じくらい\n立派なお礼を用意しないと！", 11, 0, 103611, 10, 35314, 0);
